}
 }

componentDidMount(){
  fetch('https://jsonplaceholder.typicode.com/users')
  .then(res=>res.json())
  .then(user=>this.setState(()=>{{monsters:user}}))
}

  render(){
      return (
        <div class='App'>
          {
             this.state.monsters.map(el=>{
              <div key={el.id}>
                <h1>{el.name}</h1>
              </div>
            })
          }
        </div>


      )
  }


}

